DROP TABLE IF EXISTS `pvSellPoint`;
CREATE TABLE `pvSellPoint` (
  `SellPointID` int(4) NOT NULL AUTO_INCREMENT COMMENT '专营店ID',
  `SellPointName` varchar(50) NOT NULL DEFAULT '' COMMENT '专营店名称',
  `SellPointJName` varchar(255) NOT NULL DEFAULT '' COMMENT '曾用专营店名',
  `Coding` varchar(100) NOT NULL DEFAULT '' COMMENT '专营店编码',
  `Email` varchar(100) NOT NULL DEFAULT '' COMMENT '专营店邮箱',
  `Email_BK` varchar(200) NOT NULL DEFAULT '' COMMENT '专营店备份邮箱',
  `Department` varchar(40) NOT NULL DEFAULT '-',
  `Area` varchar(30) DEFAULT NULL COMMENT '区',
  `Area_2014` varchar(30) DEFAULT NULL,
  `Region` varchar(100) DEFAULT NULL COMMENT '大区2012',
  `Region_2014` varchar(100) DEFAULT NULL,
  `SpArea` varchar(30) NOT NULL DEFAULT '' COMMENT '大区',
  `SpSArea` varchar(30) NOT NULL DEFAULT '' COMMENT '小区',
  `SpSArea_2014` varchar(30) DEFAULT NULL,
  `Area_2015` varchar(30) DEFAULT NULL COMMENT '2015年地区',
  `Region_2015` varchar(30) DEFAULT NULL COMMENT '2015年大区',
  `SpSArea_2015` varchar(30) DEFAULT NULL COMMENT '2015年小区',
  `SpCArea` varchar(30) NOT NULL DEFAULT '' COMMENT '专员小区',
  `qicheng_Area` varchar(255) DEFAULT NULL COMMENT '启程区',
  `qicheng_SpSArea` varchar(255) DEFAULT NULL COMMENT '启程小区	',
  `Province` varchar(20) NOT NULL DEFAULT '' COMMENT '省份',
  `County` varchar(20) NOT NULL DEFAULT '' COMMENT '城市',
  `Level` char(1) NOT NULL DEFAULT '' COMMENT '专营店级别',
  `CountyLevel` char(1) NOT NULL DEFAULT '' COMMENT '城市级别',
  `Account` varchar(40) NOT NULL DEFAULT '' COMMENT '帐号',
  `Password` varchar(40) NOT NULL DEFAULT '' COMMENT '密码',
  `SpState` varchar(10) NOT NULL DEFAULT '1' COMMENT '是否为专营店帐号（1:专营店,11:启辰专营店 100：用户nissan 101:用户启程 102双品牌）',
  `SpState_sys` int(8) DEFAULT NULL COMMENT '权限系统（是否为专营店帐号（1:专营店,11:启辰专营店 100：用户nissan 101:用户启程 102双品牌））',
  `SellStat` char(1) NOT NULL DEFAULT '',
  `MBA` char(1) NOT NULL DEFAULT '',
  `SaftyChina` char(1) NOT NULL DEFAULT '',
  `ADNWPermission` varchar(20) NOT NULL DEFAULT '',
  `FundPermission` char(2) NOT NULL DEFAULT '',
  `TpPermission` char(1) NOT NULL DEFAULT '0',
  `SpBArea` varchar(255) NOT NULL DEFAULT '',
  `CPName` varchar(255) NOT NULL DEFAULT '',
  `Address` varchar(255) NOT NULL DEFAULT '' COMMENT '专营店地址',
  `ZipCode` varchar(255) NOT NULL DEFAULT '' COMMENT '邮编',
  `SelTel` varchar(255) NOT NULL DEFAULT '' COMMENT '销售热线电话1',
  `SelTel2` varchar(255) NOT NULL DEFAULT '' COMMENT '销售热线电话2',
  `SelTel3` varchar(255) NOT NULL DEFAULT '' COMMENT '销售热线电话3',
  `SrvTel` varchar(255) NOT NULL DEFAULT '' COMMENT '服务热线电话1',
  `SrvTel2` varchar(255) NOT NULL DEFAULT '' COMMENT '服务热线电话2',
  `SrvTel3` varchar(255) NOT NULL DEFAULT '' COMMENT '服务热线电话3',
  `MTel` varchar(255) NOT NULL DEFAULT '',
  `MTel2` varchar(255) NOT NULL DEFAULT '',
  `MTel3` varchar(255) NOT NULL DEFAULT '',
  `Fax` varchar(255) NOT NULL DEFAULT '' COMMENT '传真号',
  `SrvFax` varchar(255) NOT NULL DEFAULT '' COMMENT '服务传真',
  `MFex` varchar(255) NOT NULL DEFAULT '',
  `TelAreaCode` varchar(10) NOT NULL DEFAULT '',
  `ProvincePY` varchar(200) NOT NULL DEFAULT '',
  `SpName` varchar(200) NOT NULL DEFAULT '',
  `SpNamePY` varchar(200) NOT NULL DEFAULT '',
  `SpNameSPY` varchar(200) NOT NULL DEFAULT '',
  `Sort` int(8) NOT NULL DEFAULT '0',
  `ZXS` char(1) NOT NULL DEFAULT '2',
  `SH` char(1) NOT NULL DEFAULT '0',
  `SortNew` int(4) NOT NULL DEFAULT '0',
  `TmpLevel` int(4) NOT NULL DEFAULT '0' COMMENT '城市级别（物料）',
  `UpdateTime` varchar(20) NOT NULL DEFAULT '0000-00-00 00:00:00',
  `Remarks` text COMMENT '备注',
  `Tel` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `RMPGrade` varchar(255) DEFAULT NULL COMMENT 'RMP等级',
  `role_id` int(10) NOT NULL DEFAULT '0' COMMENT '角色ID,有角色ID的代表是管理端账号 对应 结构js_role表ID。0表示还没划分权限，-1表示自定义',
  `jurisdiction_type` int(4) DEFAULT '1' COMMENT '权限划分方式 1根据用户类型 2自定义',
  `isOpen` int(4) DEFAULT '1' COMMENT '是否启用 1为启用 2为停用',
  `isAdminManager` int(4) DEFAULT '0' COMMENT '权限系统后台管理员授权状态 1启用 2停用',
  `manager1` int(4) DEFAULT '0' COMMENT '后台系统用户权限管理 1为有权限 0为没权限',
  `manager2` int(4) DEFAULT '0' COMMENT '营销网专营店及权限管理 1为有权限 0为没权限',
  `manager3` int(4) DEFAULT '0' COMMENT '营销网用户管理 1为有权限 0为没权限',
  `manager4` int(4) DEFAULT '0' COMMENT '营销网用户组权限管理 1为有权限 0为没权限',
  `logtime` varchar(20) DEFAULT '0000-00-00 00:00:00' COMMENT '登陆时间',
  `sign` int(1) DEFAULT NULL,
  PRIMARY KEY (`SellPointID`),
  KEY `SpArea` (`SpArea`,`SpSArea`,`SpCArea`,`Province`,`County`)
) ENGINE=MyISAM AUTO_INCREMENT=4038 DEFAULT CHARSET=latin1 COMMENT='专营店信息表';

